                        <div className="Land2"></div>

                    </div>

                    <div className="card">
                        {/* <img className="card-img-top" src={Land3} alt="Card image cap" /> */}
                        <div className="Land3"></div>

                    </div>
                </div>









            </React.Fragment>




        );



    }




}
export default MainComp;
